import React, { Component }  from 'react';
import Grid from '@material-ui/core/Grid';
import Plot from 'react-plotly.js';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';





class StatsMain extends Component {
  constructor(props){
    super(props);
    this.state = {};
  }



  render(){
    const { classes } = props;
    const styles = {
      card: {
        minWidth: 275,
      },
      bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
      },
      title: {
        fontSize: 14,
      },
      pos: {
        marginBottom: 12,
      },
    };




    return(<div> 
     <h1> Estad√≠sticas de mi negocio </h1>


    <Grid container >
        <Grid item sm>
      <Plot
        data={[
          {
            x: ["Enero","Febrero","Marzo","Abril","Mayo"],
            y: [1500, 2500, 2000, 2700, 3200, 3000],
            type: 'scatter',
            mode: 'lines+points',
            marker: {color: 'red'},
          },
        ]}
        layout={ {width: 700, height: 600, title: 'Ingresos a la fecha'} }
      />
        </Grid>
        <Grid item sm>




    <Card className={classes.card}>
      <CardContent>
        <Typography className={classes.title} color="textSecondary" gutterBottom>
          Clientes Activos
        </Typography>
        <Typography variant="h5" component="h2">
          12
        </Typography>
        <Typography className={classes.pos} color="textSecondary">
          adjective
        </Typography>
        <Typography component="p">
          well meaning and kindly.
          <br />
          {'"a benevolent smile"'}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>

        </Grid>
    </Grid>



    </div>)
  }

}

export default withStyles(styles)(StatsMain) ;
